import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {};

  render() {
    // let grids = [];
    // for (let i = 0; i < 1000; i++) {
    //   grids.push(<div class="grid-item"></div>);
    // }
    let testArr = ["hello", "and", "goodbye"];

    //  return <div class="grid-container">{grids}</div>;
    return { testArr };
  }
}

React.createElement;

export default Node;
